.eqv BASE_ADDRESS 0x10008000
.eqv GREEN 0x0ff000
.eqv RED 0xff0000
.eqv YELLOW 0xffff00
.eqv BLACK 0x000000

.globl main
.text



main: 
    	jal CLEARSCREEN
    	
    	#draw startmenu
	jal drawstartmenu
    	
    	#start game..
    	jal startMenu
    	
    	jal CLEARSCREEN
    	
    	# Load base address + offset into $t0 (the graphics memory starting point)
    	la $t0, BASE_ADDRESS
    	addi $t0, $t0, 8296  # Assuming the offset of what positions us where we want to start drawing
    	sw $t0, p1_starting
	addi $t0, $t0, 64 #destination
	sw $t0, p1_final
	subi $t0, $t0, 64

	
   	 # Load the color value for green into $t1
    	li $t1, GREEN
	#draw the platforms
	
    	# Initialize counter $t8 to 0 (we will draw 12 pixels)
    	li $t8, 0
    	li $t9, 30  # Set our target count to 12
    	sw $t9, platformLength
    	sw $t0, p1_Position
    	jal draw_p1 
    	

	#11280 
	la $t0, BASE_ADDRESS
    	addi $t0, $t0, 5136
    	sw $t0, p2_starting
    	addi $t0, $t0, 256
    	sw $t0, p2_final
    	subi $t0, $t0, 256
    	li $t8, 0
    	sw $t0, p2_Position
    	jal draw_p2 
    	
    	la $t0, BASE_ADDRESS
    	addi $t0, $t0, 3256
    	li $t8, 0
    	jal draw_p3 
    	
    	la $t0, BASE_ADDRESS
    	addi $t0, $t0, 12816
    	li $t8, 0
    	jal draw_p4 
    	
    	la $t0, BASE_ADDRESS
    	addi $t0, $t0, 12188
    	li $t8, 0
    	jal draw_p5
    	
    	#draw character at 12576, jumpy 11296
    	la $s7, BASE_ADDRESS
    	addi $s7, $s7, 1284
    	
    	sw $s7, Char_Position
    	
    	jal DRAWCHAR
    	#use s7 for char position
    	
    	
    	
    	#draw obj1
    	la $t0, BASE_ADDRESS
    	addi $t0, $t0, 2520
    	sw $t0, obj1_Position
    	jal DRAWOBJ1
    	
    	#draw obj2
    	la $t0, BASE_ADDRESS
    	addi $t0, $t0, 7560
    	jal DRAWOBJ1
    	
	#draw obj3
    	la $t0, BASE_ADDRESS
    	addi $t0, $t0, 11452
    	jal DRAWOBJ1
    	
	#draw obj4
    	la $t0, BASE_ADDRESS
    	addi $t0, $t0, 4400
    	jal DRAWOBJ1
    	
    	#jal CLEARCHAR
    	
    	#draw score bar beginning
    	la $t0, BASE_ADDRESS
    	addi $t0, $t0, 788
    	sw $t0, scoreBar
    	
    	#drawscorebase
    	jal draw_score_base
    	
    	
    	j LEVEL1
    	
    	la $t0, BASE_ADDRESS
    	li $v0, 10
    	syscall  
     


draw_p1:
	# Draw pixel by storing color in the address pointed by $t0
	sw $t1, 0($t0)

	# Increment $t0 to point to the next pixel's address
	addi $t0, $t0, 4  # since each pixel is 4 bytes 

	# Store the updated position back to Dot_Position (if needed elsewhere)
	lw $t3, p1_Position
