#t2 stores whether we move the platform left or right
#t3 stores our leftmost position our platform can be on
movePlatform:
	add $gp, $ra, $zero
	lw $t4, 0($t2)
	beq $t4, 0, moveRight
	beq $t4, 1, moveLeft
	
moveRight:
	lw $t6, 0($t0)
	bgt $t6, $t1, setDirectionLeft
	jal clearPlatform
	lw $t1, 0($t0)
	addi $t1, $t1, 4
	sw $t1, 0($t0)
	jal makePlatform
	jr $gp
	
