	lw $t6, 0($t0)
	blt $t6, $t3, setDirectionRight
	jal clearPlatform
	lw $t1, 0($t0)
	subi $t1, $t1, 4
	sw $t1, 0($t0)
	jal makePlatform
	jr $gp
	
setDirectionLeft:
	li $t6, 1
	sw $t6, 0($t2) 
	jal clearPlatform
	lw $t1, 0($t0)
	addi $t1, $t1, 4
	sw $t1, 0($t0)
	jal makePlatform
	jr $gp
	
