	li $t6, 0
	sw $t6, 0($t2) 
	jal clearPlatform
	lw $t1, 0($t0)
	subi $t1, $t1, 4
	sw $t1, 0($t0)
	jal makePlatform
	jr $gp
	
makePlatform:
	lw $t1, 0($t0)
	lw $t9, platformLength
	li $t2, 0
	li $t5, GREEN
	lw $t4, 0($t0)
	
makePlatformLoop:
	bgt $t2, $t9, endLoop 
	sw $t5, 0($t1)
	addi $t2, $t2, 1
	addi $t1, $t1, 4
	j makePlatformLoop

#We assume that $t0 has been set to the address in memory that we need to move of the platform
clearPlatform:
	lw $t1, 0($t0)
	lw $t9, platformLength
	li $t2, 0
	li $t3, BLACK
	lw $t4, 0($t0)
	
clearPlatformLink:
	bgt $t2, $t9, endLoop 
	sw $t3, 0($t1)
	addi $t2, $t2, 1
	addi $t1, $t1, 4
	j clearPlatformLink
	
	
