	addi $t9, $t9, 1
	sw $t9, scoreP
	
	#draw
	lw $s0, scoreBar
	li $t1, YELLOW
	addi $s0, $s0, 4 #go one
	sw $t1, 0($s0) #draw
	addi $s0, $s0, 4 #go one
	sw $t1, 0($s0) #draw
	addi $s0, $s0, 4 #go one
	sw $t1, 0($s0) #draw
	addi $s0, $s0, 4 #go one
	sw $t1, 0($s0) #draw
	
	#store new bar location
	sw $s0, scoreBar
	
	jr $gp
#basic implementation of moving a piece
MOVE:
#0xffff0000 is the address of the stored key that user pressed
	la $t2, 0xffff0000
	#t3 is 1 if a key has been pressed
	lw $t3, 0($t2)
	beq $t3, 1, MOVEPIECE 
	jr $ra

#This part is only reached if a key has been pressed
MOVEPIECE:

	#4 bytes from t2 is where the code of the key pressed will be
	lw $s2, 4($t2)
	#w key	
	beq $s2, 119, MOVEUP
	#a key
	beq $s2, 97, MOVELEFT
	#d key
	beq $s2, 100, MOVERIGHT
	#r key 
	beq $s2, 114, main
	#q key
	beq $s2, 113, ENDGAME
	
	jr $ra
	
MOVEP:
#0xffff0000 is the address of the stored key that user pressed
	la $s3, Dot_Position
	lw $s5, 0($s3)
	li $s4, 0x000000
	#stores value of s5 which is the address of dot_pos into s4
	#sw $s4, 0($s5)
	blt $s5, BASE_ADDRESS, wrap_to_bottom
	subi $s5, $s5, 256
	#move the dot
	sw $t1, 0($s5)
	#store new position 
	sw $s5, 0($s3)
	#delay a second 
	li $v0, 32
	li $a0, 100
	syscall
	j MOVEP
	

wrap_to_bottom:
	addi $s5, $s5, 16384
	sw $s5, Dot_Position
	#sw $s4, 0($s5)
    	j MOVEP

CLEARSCREEN: 
	la $t0, BASE_ADDRESS
	la $t1, BASE_ADDRESS
	addi $t1, $t1, 16380 #last pixel 
	li $t2, 0x000000
	
# loop
clearloop: 
	bgt $t0, $t1, cexit
	sw $t2, 0($t0)
	addi $t0, $t0, 4
	j clearloop
cexit:	
	jr $ra
	
drawbackground:
	la $t0, BASE_ADDRESS
	la $s7, BACKGROUND
	add $t8 $zero, $zero
	addi $t1, $t0, 16380 #last pixel address
	
backgroundL:
	bgt $t0, $t1, backExit
	sll $t9, $t8, 2
	add $t4, $s7, $t9
	lw $t5, 0($t4)
	sw $t5, 0($t0)
	addi $t8, $t8, 1
	addi $t0, $t0, 4
	j backgroundL
	
backExit:
	jr $ra

drawWinBackground: 
	la $s7, WINB
	la $t0, BASE_ADDRESS
	add $t8 $zero, $zero
	addi $t1, $t0, 16380
	
backgroundLW:
	bgt $t0, $t1, backgroundExitW
	sll $t9, $t8, 2
	add $t4, $s7, $t9
	lw $t5, 0($t4)
	sw $t5, 0($t0)
	addi $t8, $t8, 1
	addi $t0, $t0, 4
	j backgroundLW
	
backgroundExitW:
	jr $ra

startMenu:
	
	
	#0xffff0000 is the address of the stored key that user pressed
	la $t2, 0xffff0000
	#t3 is 1 if a key has been pressed
	lw $t3, 0($t2)
	beq $t3, 1, KEYPIECE 
	j startMenu
	

#This part is only reached if a key has been pressed
KEYPIECE:

	#4 bytes from t2 is where the code of the key pressed will be
	lw $s2, 4($t2)
	#q key
	beq $s2, 113, ENDGAME
	#y key 
	bne $s2, 121, startMenu
	
	
	jr $ra
	
	
drawstartmenu: 
	la $s7, start_menu_b
	la $t0, BASE_ADDRESS
	add $t8 $zero, $zero
	addi $t1, $t0, 16380
	
backgroundS:
	bgt $t0, $t1, backgroundExitS
	sll $t9, $t8, 2
	add $t4, $s7, $t9
	lw $t5, 0($t4)
	sw $t5, 0($t0)
	addi $t8, $t8, 1
	addi $t0, $t0, 4
	j backgroundS
	
backgroundExitS:
	jr $ra
	

	
	
	
